export const getPythOracleUrl = (coinType: string) => {
  const symbol = COINTYPE_PYTH_PRICE_ID_SYMBOL_MAP[coinType].symbol;
  if (!symbol) return null;

  return `https://pyth.network/price-feeds/${symbol.toLowerCase().replace(/\.|\//g, "-")}?range=1W`;
};

export const extractSymbolFromCoinType = (coinType: string) =>
  coinType.split("::").at(-1);

export const isSendPoints = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_SEND_POINTS_COINTYPE;
export const isSui = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_SUI_COINTYPE;

export const isStablecoin = (coinType: string) =>
  NORMALIZED_STABLECOIN_COINTYPES.includes(normalizeStructTag(coinType));
export const isEth = (coinType: string) =>
  NORMALIZED_ETH_COINTYPES.includes(normalizeStructTag(coinType));

export const isCoinType = (text: string) => {
  if (text.includes("-")) return false;
  try {
    normalizeStructTag(text);
    return true;
  } catch (err) {}
  return false;
};
